'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href','section'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/docs/install/','title':"MapGIS安装",'section':"Docs",'content':"视频教程  Mapgis制图  MapGIS安装  下载并解压，链接 百度网盘 提取码：vbox 双击运行MapGIS 安装程序 Setup67.EXE  点击下一步  直到弹出如下界面 计算机名或者IP地址填入 127.0.0.1 。如果填入IP地址失败，则尝试填入自己的计算机名 （右键此电脑-查看设备名称） 。  双击运行虚拟狗 DogServer67.exe 右下角出现虚拟狗图标，点击确定  弹出三维绘制引擎选择 OpenGL 3D，确定  弹出如下界面，点击完成，安装成功。  桌面上双击如下图标，打开 MAPGIS67主菜单\n  "});index.add({'id':1,'href':'/docs/install_arcgis/','title':"ArcGIS 安装",'section':"Docs",'content':"视频教程  ArcGIS入门教程  1 下载  下载链接 百度网盘 提取码：zdem 解压，得到如下图所示文件。  目录结构如下  Desktop 主程序 # ArcGIS安装程序 Setup.exe 所在目录 DesktopChinese CN1 patched DesktopChinese CN.msi # 汉化程序 DesktopChinese CN1.cab    2 安装  双击安装程序 .\\Desktop 主程序\\Setup.exe , 约15分钟后，完成安装 ArcGIS   3 破解  将 .\\patched\\AfCore.dll 复制到安装目录 C:\\Program Files (x86)\\ArcGIS\\Desktop10.8\\bin ，替换掉原来的 AfCore.dll 。   4 汉化  双击 .\\DesktopChinese_CN.msi ,等待安装完成即可。  5 运行  windows开始菜单找到 ArcMap 10.8 ，单击即可打开。   致谢： 王子恒（ArcGIS）\n"});index.add({'id':2,'href':'/docs/install_gocad/','title':"GOCAD安装",'section':"Docs",'content':"SKUA-GOCAD 17.0安装  下载压缩包并解压出文件夹 Paradigm SKUA-GOCAD 2017 x64 ，链接 百度网盘 提取码：zdem  打开文件夹，双击运行 SKUA-GOCAD-17-Windows-x64.msi 安装程序\n 按照提示点击next，选择默认安装路径为 C:\\Program Files\\Paradigm\\SKUA-GOCAD-17 ，根据提示点击next\n 根据提示点击install\n 安装完成后点Finish\n 破解。打开 Crack 文件夹,将其中的 PGILc.dll 文件复制到软件安装路径默认为 C:\\Program Files\\Paradigm\\SKUA-GOCAD-17\\Gocad\\bin\\Win_x64_6.1_v12 中覆盖源文件\n 在C盘根目录下新建flexlm文件夹。\n 将Crack中的license.dat文件复制到C:\\flexlm中，如下图所示\n SKUA-GOCAD 17.0软件安装完成，双击桌面图标打开软件\n 点击New Project新建项目,自定义项目名称\n 点击Select All加载所有模块\n 开始使用。\n  致谢： 朱素芹（GoCAD）\n"});index.add({'id':3,'href':'/docs/install_abaqus/','title':"Abaqus安装",'section':"Docs",'content':"Abaqus 2022 安装 注意事项  安装过程中，不要使用中文目录。 建议都安装到C盘。安装到其他盘，如果无法打开，请卸载后，安装到C盘。 安装前关闭杀毒软件。  下载并解压  下载压缩包 DS.SIMULIA.Suite.2022.Win64.zip.001 和 DS.SIMULIA.Suite.2022.Win64.zip.002 ， 下载链接 百度网盘 提取码：zdem 右键 DS.SIMULIA.Suite.2022.Win64.zip.001 解压出文件夹DS.SIMULIA.Suite.2022.Win64 ，注意 DS.SIMULIA.Suite.2022.Win64.zip.001 和 DS.SIMULIA.Suite.2022.Win64.zip.001 为 DS.SIMULIA.Suite.2022.Win64 分卷压缩（为了保证每个压缩包小于4G）得到，它俩共同出现才能解压出了 DS.SIMULIA.Suite.2022.Win64， 所以只需解压一次即可。   安装软件许可证  首先设置环境变量，鼠标右键点击桌面此电脑，选择属性\n 打开高级系统设置，点击环境变量，在系统变量下点击新建，输入变量名：NOLICENSECHECK,变量值：true，点击确定  进入 ./DS.SIMULIA.Suite.2022.Win64/solidSQUAD_ 文件，解压 SSQ_UniversalLicenseServer_Core_20180127074300.zip 和 SSQ_UniversalLicenseServer_Module_DSSimulia_20201125092500.zip  运行破解文件  将 .\\SSQ_UniversalLicenseServer_Module_DSSimulia_20201125092500\\Vendors 文件夹复制到 ./SSQ_UniversalLicenseServer_Core_20180127074300/SolidSQUAD_License_Servers 文件夹中， 然后将 ./SSQ_UniversalLicenseServer_Core_20180127074300/SolidSQUAD_License_Servers 文件夹复制到 C:/abaqus （必须复制到C盘abaqus下）文件夹 （如没有该文件夹，自行创建）。 右键以管理员身份运行 install_or_update.bat （文件类型： windows批处文件）。    等待，破解完成出现如下图所示，按任意键继续\u0026hellip;，即完成破解。   安装Abaqus  右键用windows资源管理器打开 DS.SIMULIA.Suite.2022.Win64.iso ，将其装载到了虚拟光驱。  以管理员身份运行 ./1/setup.exe 安装程序  点击下一步\n 采用默认选择，点击下一步\n 点击安装\n 安装过程中，弹出如下图所示界面，点击浏览，选择文件2。  点击确定\n 选择安装的目录，点击下一步。  选择如图所示的选项，点击下一步  按照默认选项，点击下一步。  输入27800@localhost，点击下一步。  选择设置安装的目录，点击下一步  点击下一步  默认，点击下一步。  点击下一步  点击安装  点击continue  点击关闭  点击浏览，选择文件夹3，点击确定  选择安装目录 C:\\SIMULIA\\EstProdudts\\2022 ，点击下一步。  全选，点击下一步。  点击安装  点击关闭  选择目录，点击下一步  全部选择，点击下一步  点击下一步  点击下一步  点击下一步  点击安装  点击关闭  安装完成，点击关闭   运行软件  在开始菜单中找到Abaqus CAE，点击打开  打开后，软件界面如下图   Abaqus软件汉化  在文件夹 C:\\SIMULIA\\EstProducts\\2021\\win_b64\\SMA\\Configuration 中，找到 locale.txt 文件  用记事本打开 locale.txt ，加入一行 Chinese (Simplified)_China.936 = zh_CN (注意 Chinese 后有一个空格！) ，然后将 zh_CH=0 改为 zh_CH=1 ，然后保存，关闭。  再次打开软件，显示界面如下图，即成功汉化。   致谢： 池禹（Abaqubs）\n"});})();